import React from 'react'
import { TokenContext, UsernameContext } from './Context/Context'

export default function HomeScreen () {
    return (
      <UsernameContext.Consumer>
        {([username, setUsername]) => {
          return (
            <>
              <Text>Welcome !</Text>
              <Text>You are logged as {username}</Text>
            </>
          )
        }}
      </UsernameContext.Consumer>
    )
  }
